class MaxHeap:
    
    def __init__(self):
        self.array = []
        self.len_heap = 0
    def parent(self,i):
        return int((i-1)/2)
    def leftvalue(self,i):
        return int((2*i)+1)
    def rightvalue(self,i):
        return int((2*i)+2)
    def swap(self, i, parent):
        self.array[i], self.array[parent] =  self.array[parent], self.array[i]
    def insert_value(self, value):
        self.array.append(value)
        self.len_heap += 1
        i = self.len_heap -1
        while (i!=0 and self.array[i] > self.array[self.parent(i)]):
            self.swap(i, self.parent(i))
            i = self.parent(i)
    def print_heap(self):
        print(self.array)


    def heapify(self, i):
        greatest = i

        l = self.leftvalue(i)
        r = self.rightvalue(i)

        if l < self.len_heap and self.array[l] > self.array[i]: greatest = l
        if r < self.len_heap and self.array[r] > self.array[greatest]: greatest = r

        if greatest !=i:
            self.swap(i, greatest)
            self.heapify(greatest)



    def extractMax(self):
        if self.len_heap <=0:
            return
        if self.len_heap == 1:
            self.len_heap -=1
            a = self.array.pop()
            return a

        maximum = self.array[0]
        self.array[0] = self.array[-1]
        self.array.pop()
        self.len_heap -=1
        self.heapify(0)
        return maximum

    def get_max(self):
        return self.array[0]

    def len_heap(self): return self.len_heap

class MinHeap:
    def __init__(self):
        self.array = []
        self.len_heap = 0

    def parent(self,i): return int((i-1)/2)

    def leftvalue(self,i): return int((2*i)+1)

    def rightvalue(self,i): return int((2*i)+2)

    def swap(self, i, parent):
        self.array[i], self.array[parent] =  self.array[parent], self.array[i]
    

    def heapify(self, i):
        smallest = i

        l = self.leftvalue(i)
        r = self.rightvalue(i)

        if l < self.len_heap and self.array[l] < self.array[i]: smallest = l
        if r < self.len_heap and self.array[r] < self.array[smallest]: smallest = r

        if smallest !=i:
            self.swap(i, smallest)
            self.heapify(smallest)



    def insert_value(self, value):
        self.array.append(value)
        self.len_heap += 1

        i = self.len_heap -1

        while (i!=0 and self.array[i] < self.array[self.parent(i)]):
            self.swap(i, self.parent(i))
            i = self.parent(i)
    def print_heap(self):
        print(self.array)

    def extractMin(self):
        if self.len_heap <=0:
            return
        if self.len_heap == 1:
            self.len_heap -=1
            a = self.array.pop()
            return a

        minimum = self.array[0]
        self.array[0] = self.array[-1]
        self.array.pop()
        self.len_heap -=1
        self.heapify(0)
        return minimum

    def get_min(self): return self.array[0]

    def len_heap(self): return self.len_heap

def runningMedian(a):
    max_heap = MaxHeap()
    min_heap = MinHeap()

    mean = 0

    values = []

    for i in a:

        if i >=mean:
            min_heap.insert_value(i)
        elif i < mean:
            max_heap.insert_value(i)

        if min_heap.len_heap - max_heap.len_heap >=2:
            max_heap.insert_value(min_heap.extractMin())

        elif min_heap.len_heap - max_heap.len_heap <=-2:
            min_heap.insert_value(max_heap.extractMax())


        if min_heap.len_heap - max_heap.len_heap ==1:
            mean = float(min_heap.get_min())
        
        elif min_heap.len_heap - max_heap.len_heap == -1:
            mean = float(max_heap.get_max())

        else:
            mean = (max_heap.get_max() + min_heap.get_min())/2

        values.append(mean)
    
    return values

